function processImage(imageData, height, width, weights){
    //console.log(imageData);
    var filterRadius = (weights.length - 1)/2;
    console.log('filterRadius', filterRadius);
    var gridImg = gridifyFlatArray(imageData, height, width);
    //console.log('gridded', gridImg);
    var bigImg = addBorders(gridImg, filterRadius);
    var newHeight = height + 2*filterRadius;
    var newWidth = width + 2*filterRadius;
    console.log('h', newHeight, 'w', newWidth);
    //console.log('bordered', bigImg);
    var finalFlatImg = [];
    for (var y = filterRadius; y < filterRadius+height; y++) {
        for (var x = filterRadius; x < filterRadius+width; x++) {
            //console.log(y, x);
            var minigrid = getMinigrid(bigImg, y, x, filterRadius);
            var pixel = applyWeightToPixel(minigrid, weights);
            //console.log('pixout', pixel);
            finalFlatImg = finalFlatImg.concat(pixel);
        }
    }
    console.log('ffi', finalFlatImg);
    return finalFlatImg;
}

function gridifyFlatArray(flatData, height, width) {
    var row, grid = [];
    var pixels = 0;
    for (var y = 0; y < height; y++) {
        row = [];
        for (var x = 0; x < width; x++) {
            row.push(flatData.slice(pixels,pixels+3));
            pixels += 3;
        }
        grid.push(row);
    }
    return grid;
}

function addBorders(grid, times=1) {
    while (times > 0) {
        for (var i = 0; i < grid.length; i++) {
            var row = grid[i];
            row.push(row[row.length-1]);
            row.unshift(row[0]);
            grid[i] = row;
        }
        grid.push(grid[grid.length-1]);
        grid.unshift(grid[0]);
        times--;
    }
    return grid;
}

function getMinigrid(grid, y, x, filterRadius) {  // 0 => 1x1, 1 => 3x3, 2 => 5x5, 3 => 7x7, 4 => 9x9...
    var minigrid = [];
    var dy = -1*filterRadius;
    while (dy <= filterRadius) {
        var row = [];
        var dx = -1*filterRadius;
        while (dx <= filterRadius) {
            //console.log(dy,dx);
            row.push(grid[y+dy][x+dx]);
            dx++;
        }
        minigrid.push(row);
        dy++;
    }
    //console.log('minigrid', minigrid);
    return minigrid;
}

function applyWeightToPixel(minigrid, weights) {
    //console.log(minigrid.length, weights.length, minigrid[0].length, weights[0].length);
    var rVal = 0, gVal = 0, bVal = 0;
    for (var y = 0; y < weights.length; y++) {
        for (var x = 0; x < weights.length; x++) {
            //console.log(y, x, minigrid[y][x], weights[y][x]);
            rVal += minigrid[y][x][0] * weights[y][x];
            gVal += minigrid[y][x][1] * weights[y][x];
            bVal += minigrid[y][x][2] * weights[y][x];
        }
    }
    //console.log('pixel', [parseInt(rVal), parseInt(gVal), parseInt(bVal)]);
    if (rVal < 0) rVal = 0;
    if (gVal < 0) gVal = 0;
    if (bVal < 0) bVal = 0;
    if (rVal > 255) rVal = 255;
    if (gVal > 255) gVal = 255;
    if (bVal > 255) bVal = 255;  // cropping not good
    return [parseInt(rVal), parseInt(gVal), parseInt(bVal)];
}
