function assertRGBImageDataSimilar( actual, expected, h, w, msg ){
    var thingToMatch = function(e,i){
        return Math.abs(e - actual[i]) <= 3;
    };
    Test.expect( expected.every(thingToMatch), msg );
}

function putImageData( imageData, height, width, displayHeight, displayWidth ){
    var displayID = Math.random().toString(36).replace(/[^a-z]+/g, ''),
    testMessage = '' +
    '<canvas id="cvs' + displayID + '" ' +
    'onmousedown="' +
    '  console.log(\'omg!\');' +
    '  var txt = getElementById(\'txt' + displayID + '\');' +
    '  txt.style.display=\'inline\';' +
    '" />' +
    '<textarea id="txt' + displayID + '" style="display:none;" rows=8 cols=40>' +
    JSON.stringify(imageData) +
    '</textarea>' +
    '<script>\n' +
    '(function(imageData){\n' +
    '  var canvas = document.getElementById("cvs' + displayID + '"),\n' +
    '  context = canvas.getContext("2d"),\n' +
    '  data;\n' +
    '  canvas.width = ' + width + ';\n' +
    '  canvas.height = ' + height + ';\n' +
    '  canvas.style.width = "' + displayWidth + 'px";\n' +
    '  canvas.style.height = "' + displayHeight + 'px";\n' +
    '  data = context.getImageData( 0, 0 ,' + width + ', ' + height + ');\n' +
    '  imageData.forEach(function(e,i){data.data[i]=e;});\n' +
    '  context.putImageData( data, 0, 0 );\n' +
    '}(' + JSON.stringify(RGBtoRGBA(imageData)) + '));\n' +
    '</script>';
    console.log(testMessage);
}

function RGBtoRGBA( imageData ){
    var out;
    if(imageData instanceof Array){
        out = [].concat(imageData);
        for(var i=3; i<=out.length; i+=4) {
            out.splice(i,0,255);
        }
    }
    return out;
}

